const tHBtn1 = `Official Website`;
const tHBtn2 = `Image`;
const tHBtn3 = `View Project`;

const tHLink1 = `http://www.google.com`;
const tHLink2 = `http://www.google.com`;
const tHLink3 = `http://www.google.com`;


const croBtn1 = `Official Website`;
const croBtn2 = `Image`;

const croLink1 = `http://www.google.com`;
const croLink2 = `#`;



const hPBtn1 = `Official Website`;
const hPBtn2 = `Image`;
const hPBtn3 = `View Project`;

const hPLink1 = `http://www.google.com`;
const hPLink2 = `http://www.google.com`;
const hPLink3 = `http://www.google.com`;



const tHPair = {
    btn1: [tHBtn1, tHLink1],
    btn2: [tHBtn2, tHLink2],
    btn3: [tHBtn3, tHLink3]
};

const croPair = {
    btn1: [croBtn1, croLink1],
    btn2: [croBtn2, croLink2]
};
const hPPair = {
    btn1: [hPBtn1, hPLink1],
    btn2: [hPBtn2, hPLink2],
    btn3: [hPBtn3, hPLink3]
};

const terminalButton = [tHPair, croPair, hPPair];

console.log(terminalButton.keys[0]);

//export { terminalButton };
